ight: 1.2; vertical-align: top; width: 662px; white-space: normal; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="font-size: 20px"><font style="font-size: 20px">Imagine living on an island, leading the way in innovative industry. Our island relies too heavily on the fast fading financial sector. It’s time to think outside of the box and pay close attention to Hemp! Hemp could pull Manx Farming out of its struggles, allowing farmers the market fluidity to adapt to the ever changing world as well as revolutionise the construction industry and all this at zero cost to the environment!</font></p><p style="font-size: 20px"><font style="font-size: 20px">Hemp IS NOT a drug. It’s a WONDER crop.</font></p><p style="font-size: 20px"><font style="font-size: 20px">Hemp industry is booming! This crop is versatile, profitable and sustainable, the need for sustainability is ever increasing! It’s time old fashioned, poorly educated views were quashed and the Isle of Man Government gave the backing for hemp growing.</font></p><p style="font-size: 20px"><font style="font-size: 20px">Hemp has recently been rediscovered as a plant that has enormous environmental, economic, and commercial potential.</font></p><p style="font-size: 20px"><font style="font-size: 20px">Please support this petition so that Manx Farmers would be given licenses to grow Hemp on our island.</font></p></div></div></foreignObject><text x="331" y="259" fill="#000000" text-anchor="middle" font-size="40px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><path d="M 510.94 1173 C 507.38 1173 504.5 1170.1 504.5 1166.51 L 504.5 1119.49 C 504.5 1115.9 507.38 1113 510.94 1113 L 558.06 1113 C 561.62 1113 564.5 1115.9 564.5 1119.49 L 564.5 1166.51 C 564.5 1170.1 561.62 1173 558.06 1173 Z" fill="url(#mx-gradient-6294e4-1-1a2665-1-s-0)" stroke="none" pointer-events="none"/><path d="M 534.66 1173 L 534.66 1153.42 L 527.12 1153.42 L 527.12 1143.88 L 534.66 1143.88 L 534.66 1138.99 C 534.66 1132.13 540.06 1126.73 546.16 1126.73 L 553.67 1126.73 L 553.67 1136.29 L 546.15 1136.29 C 545.34 1136.29 544.25 1137.47 544.25 1138.8 L 544.25 1143.88 L 553.67 1143.88 L 553.67 1153.42 L 544.25 1153.42 L 544.25 1173 Z" fill="#ffffff" stroke="none" pointer-events="none"/><path d="M 504.5 1119.49 C 504.5 1115.9 507.38 1113 510.94 1113 L 558.06 1113 C 561.62 1113 564.5 1115.9 564.5 1119.49 L 564.5 1135.3 C 545.57 1144.59 523.43 1144.59 504.5 1135.3 Z" fill-opacity="0.2" fill="#ffffff" stroke="none" pointer-events="none"/><g transform="translate(192.5,1129.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="286" height="27" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 24px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; white-space: nowrap; font-weight: bold; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;">Read About this more on</div></div></foreignObject><text x="143" y="26" fill="#000000" text-anchor="middle" font-size="24px" font-family="Helvetica" font-weight="bold">Read About this more on</text></switch></g><rect x="317" y="13" width="120" height="60" fill-opacity="0" fill="#ffffff" stroke="none" pointer-events="none"/><g transform="translate(67.5,1252.5)"><switch><foreignObject style="overflow:visible;" pointer-events="all" width="665" height="1720" requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility"><div xmlns="http://www.w3.org/1999/xhtml" style="display: inline-block; font-size: 40px; font-family: Helvetica; color: rgb(0, 0, 0); line-height: 1.2; vertical-align: top; width: 665px; white-space: normal; word-wrap: normal; text-align: center;"><div xmlns="http://www.w3.org/1999/xhtml" style="display:inline-block;text-align:inherit;text-decoration:inherit;"><p style="line-height: 0% ; font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Here are some facts on Hemp:</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Hemp is nutritious<br style="font-size: 24px" />Okay, this may not be new news, but did you know that the hemp seed has the same nutrient that is also in…. wait for it… breast milk. The hemp seed holds an oil that is rich in gamma linolenic acid (GLA), just as in breast milk.</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Hemp helps the environment<br style="font-size: 24px" />Did you know that hemp can eliminate toxins and radioactive material? It’s true! To test this, scientists planted hemp at Chernobyl and discovered that hemp conducted phytoremediation and decomposed chemicals from the soil better than any house plant, or any plant for that matter.</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Hemp enriches<br style="font-size: 24px" />Hemp is equipped with deep roots that allows it to grow in various types of soil and terrains. Not only is it versatile, hemp can even hold soil together. In the past, it has been used for this purpose after clear cutting of trees. Bet you didn’t know that?</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>When the hemp plant is reaped, the stem and leaves contain so many nutrients that many farmers take what they don’t need and put it back in the soil. This process rejuvenates the soil even more, enriching the soil with nitrogen, aiding with an even larger yield for the next season.</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Hemp can build houses and even cars<br style="font-size: 24px" />Whaaat? Yes, really! It all started in 1941, when Henry Ford owned a car made of soybean hemp and plastics. It was lighter than steel, but it was durable, withstanding ten times the impacts, without a single dent. In 2008 Lotus launched their eco friendly sports car, featuring lush hemp wool on the steering wheel, to hard compressed hemp making up the seats.</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Today, hemp is a popular choice for building homes because structures made from hemp are pest-free, rot-free, mold-free, and are fire-resistant. Plus, hemp plastic materials are 100% biodegradable.</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Hemp can power cars<br style="font-size: 24px" />Sure, a car can be made of hemp, but can it go? Absolutely! Hemp seed oil can be converted from into a biodegradable and toxic-free biodiesel.</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Hemp is a superhero – it could save the world<br style="font-size: 24px" />Now, hemp is no Captain Planet, but close enough. It could replace some of the effects that lead to carbon emissions, but hemp could also eliminate them. You see, hemp has a really high carbon-dioxide uptake and it starts a process named carbon sequestration that traps emissions.</sup></font></p><p style="font-size: 24px"><font style="font-size: 24px" face="Tahoma"><sup>Hemp prevents deforestation<br style="font-size: 24px" />Hemp can be used as a resource material for wood and paper, which make for a healthier earth and it’s inhabitants, humans and animals. For a one year supply of paper, it is said that one acre of hemp is equivalent to four acres of trees.</sup></font></p></div></div></foreignObject><text x="333" y="880" fill="#000000" text-anchor="middle" font-size="40px" font-family="Helvetica">[Not supported by viewer]</text></switch></g><image x="24.5" y="3051.5" width="743" height="140" xlink:href="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAggAAABiCAYAAAA1DCt2
